import { useSelector } from "react-redux";

function Home() {
  //const { portfolioData } = useSelector((state) => state.root);
  return (
    <div>
      <Header />
      <div className="bg-primary px-40 sm:px-5">
        <Intro />
        <About />
        <Experiences />
        <Products />
        <Contact />
        <Footer />
        <LeftSider />
      </div>
    </div>
  );
}

export default Home;
